import {
  FETCH_EMPLOYEES,
  FETCH_EMPLOYEE,
  CREATE_EMPLOYEE,
  CALCULATE_SALARY,
} from "../actions/types";

export default (state = {}, action) => {
  switch (action.type) {
    case FETCH_EMPLOYEES:
      return state;
    case FETCH_EMPLOYEE:
      return state;
    case CREATE_EMPLOYEE:
      return state;
    case CALCULATE_SALARY:
      return state;
    default:
      return state;
  }
};
